import React from 'react'
import './TeamCard.css'
import { FaStar } from "react-icons/fa";
const TeamCard = (props) => {
    return (
        <div className="media col-4">
           
               
                    <img src={props.image} alt="" className=' team-card-image media-body card roundedCircle ' />
                
                <div className="media-body card ">
                    <div className="media-heading">{props.name}
                    <span className="media-heading">{props.position}</span></div>
                    

             
            </div>
            <p> {props.description}</p>
        </div>

    )
}

export default TeamCard
